// src/components/Honeypot.js
import React from 'react';
import { Link } from 'react-router-dom';

const Honeypot = () => {
  return (
    <Link 
      to="/honeypot"
      style={{
        textDecoration: 'none',
        color: '#ffffff',
        backgroundColor: '#1E3A8A',
        padding: '8px 16px',
        borderRadius: '4px',
        display: 'block'
      }}
    >
      Honeypot Tool
    </Link>
  );
};

export default Honeypot;
